import React from 'react';
import { Link } from 'react-router-dom';
const Layout1 = (props) => (
  <div>
  <ul>
    <li><Link to="/">Home</Link></li>
    <li><Link to="/fields">About</Link></li>
    <li><Link to="/loginadmin">Admin</Link></li>
  </ul>
  <div>{props.children}</div>
</div>
);



export default Layout1;






